import React, {Component} from 'react';
import Head from 'next/head';
import Navbar from './Navbar'

class Layout extends Component {
	render(){
		return(
			<div>
				<Head>
					<title> Chris Ortega's Portfolio </title>
					<link rel ='stylesheet' 
					href= '<link href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous">'
					/>		
				</Head>

				<h1> test</h1>
				{this.props.children}
			</div>
			
		)
	}
}

export default Layout;
